const Api = () => {
  const [user, setUser] = useState([]);

  useEffect(() => {
    fetch('https://fakestoreapi.com/products/1').then((data)=>{
        data.json().then(result =>{
            console.warn("result" ,result)
            setUser(result.data)
        })
    })



  },[]);
  return (
    <>

            <h1>{user.result.id}</h1>



    </>
  );
};

export default Api;
